<p>Below is a quick description of the key terms that apply to all our sellers. There are important details in the whole Seller Terms and Conditions, so you should read it.</p>

<p><strong>1</strong>.&nbsp;<strong>Teyaar IPR Policy</strong>. We take any violations of intellectual property rights seriously. We are committed to removing listing and selling of products or materials that infringe someone else&rsquo;s Intellectual Property Right (<strong>IPR</strong>). You may familiarize with our IPR policies, available teyaar also report your activities and details to IPR owners, consumer affairs department and other law enforcement authorities.&nbsp;</p>

<p><strong>2</strong>.&nbsp;<strong>Counterfeits or Refurbished Products.</strong> Consumer trust is very important to us. It is a criminal offence to try to financially gain by using IPR without the owner&rsquo;s permission. teyaar will remove your listing if we suspect your products are not genuine. teyaar vigorously pursues sellers who sell counterfeit products. We work with Federal and local law enforcement officials to try to stop the sale of counterfeit products.&nbsp;</p>

<p><strong>3</strong>.&nbsp;<strong>Cancellation of Orders. </strong>You cannot delay a confirmed purchase order or cancellation of a confirmed order. Any cancellation of a confirmed order will be subject to penalty both by us and consumer affairs departments.&nbsp;</p>

<p><strong>4</strong>.&nbsp;<strong>Misleading Product Information and Advertisement.</strong> It is your duty not to place any wrong information about your products, your identity or a brand on the Site. Your advertisement must not be misleading. This means that you will not engage in any unfair trade practices, which is a criminal offence that would also involve damages.</p>

<p><strong>5</strong>.&nbsp;<strong>Product Safety. </strong>Product Safety is our top priority. It is also the foundation of customer trust. Ensuring the safety of your products must be an important criteria for selling on Teyaar. You will remain always responsible for products or any features that harm or threatens to harm individuals, and or properties.&nbsp;</p>

<p><strong>6</strong>.&nbsp;<strong>Your Content. </strong>You are solely responsible for all text, documents or&nbsp;other content or&nbsp;information uploaded, entered or&nbsp;otherwise transmitted by&nbsp;you in&nbsp;connection with your use of&nbsp;the Site. The website Terms and Conditions for use contain detailed information on content that are not prohibited on the site. So read the terms https://uae. teyaar.com/ae-en/terms-and-conditions/c/. &nbsp;As they apply to you as well. &nbsp;&nbsp;</p>

<p><strong>7</strong>.&nbsp;<strong>Your Release.</strong> You remain always responsible for all and any dispute with an end user or a third party. You will release Teyaar and each of our affiliates (and their respective employees, directors, agents and representatives) from and against any and all claims, costs, losses, damages, judgments, penalties, interest and expenses (including reasonable attorneys&rsquo; fees) arising out of any claim, action, audit, investigation, inquiry or other proceedings instituted by a third party, entity or a government agency, that arises out of or relates to your conduct, the products you sell, any content you provide, the advertisement, offer, sale or return of any products you sell, any actual or alleged infringement of any intellectual property or proprietary rights by any products you sell or content you provide.&nbsp;</p>

<p><strong>8.&nbsp;Claims. </strong>Whilst Seller terms contain detailed provisions for breaches or claims, we would like to highlight that we will withhold all payments to you and recover additional amount of AED50,000 (fifty thousand United Arab Emirates Dirhams) as an immediate first step for breach of above terms and Seller Terms. Depending on the nature of a claim, we will ask you to compensate customers and do all other necessary remedial actions without prejudice to our rights and remedies.&nbsp;</p>

<p><strong>9</strong>.&nbsp;<strong>Questions? </strong>We are always happy to help with questions you might have! Check out our FAQs or contact <strong>Teyaar</strong> for any questions in respect to Site Terms.</p>

