<p>The selling center is basically the playground for sellers, it is where you can find everything that you need to sell on Teyaar.com. You can list your products, manage your orders, and monitor your performance.<br />

We decided to separate it from the buyer&rsquo;s experience to keep you sellers engaged and focused on growing your businesses. That&rsquo;s being said, you can still buy products on Teyaar.com by simply navigating to the main site.<br />

We revamped most functionalities to make things easier and faster, starting from listing your products, going through managing your orders, and ending with getting paid.<br />

<strong>The tools are arranged according to their area, as the following:</strong><br />

<br />

<strong>Dashboard:</strong> This is similar to your car&rsquo;s dashboard. We will show you the most important numbers, action items, and gauges. More details can be found here.<br />

InventoryManagement: That&rsquo;s where you manage listing your products on Teyaar.com, we are giving you multiple tools to manage them whether you need to upload them one by one or all together. Want to know more? Just check this section.<br />

<br />

<strong>OrdersManagement</strong>: Yes, the customers&rsquo; love starts here, that&rsquo;s where you see their orders for your products. You can follow-up on them and make sure they are delivered to them on time so you can get paid and get their recommendations if all goes well. Check this article out if you need to know more.<br />

Financials: Things getting serious, isn&rsquo;t it? Don&rsquo;t worry, it&rsquo;s not as complicated as it sounds. You will see all transactions related to your sales, with details about included fees. Also you would be able to withdraw your money and transfer them to your bank account. Yay!<br />

We understand that financials could be complex to understand for some sellers, so we decided to explain how it works in this section.<br />

<br />

<strong>Performance: </strong>We believe customers&rsquo; loyalty comes from great performance. This area is dedicated for achieving this. You will see your performance review on a monthly basis, as well as managing user&rsquo;s requests and complaints. Better performance and less complaints means more trust and sales eventually. More details about performance management can be found here.<br />

<br />

<strong>Settings:</strong> Nothing special here, you can manage your account&rsquo;s details and configurations, including your business information, shipping addresses, bank account information, and others. This article includes valuable information about the settings section.<br />

Go ahead and have a look at the selling center with its different areas, you will get more comfortable as you start using them, take our word on this.</p>

<p><strong>Planning your selling strategy&nbsp;</strong></p>

<p>While it&rsquo;s easy to create an account and actually start listing your products on Teyaar.com, it&rsquo;s very important to plan for what you want to sell.<br />

The following points summarise what you need to take into consideration before listing your products onTeyaar.com:<br />

1.&nbsp;&nbsp; &nbsp;Make sure that you know what to sell, it looks like an easy question but it&rsquo;s extremely important. Focus on what customers want, and make sure you follow the trends (selling an iPhone 4 nowadays is almost useless, just compare it with how much customers want the new 6s)<br />

2.&nbsp;&nbsp; &nbsp;Invest some time studying the prices provided by other sellers on Teyaar.com, the competition is very high and prices change on a daily basis. You might consider less profit in exchange of customers love which is totally fair.<br />

3.&nbsp;&nbsp; &nbsp;If you can&rsquo;t handle shipping your products to the customers, leave it to us. Teyaar.com offers an experienced fullfillment program where we pickup your items and deliver them to the customres. We will worry about the details and eventually collect your money for you.<br />

Don&rsquo;t be afraid to compete with big names, we give the chance for all sellers and we measure by performance, the customers&rsquo; satisfaction is the key to win it all.<br />

Our team is always available for your help, don&rsquo;t hesitate to contact us on support@ Teyaar.com and we&rsquo;ll be more than happy to assist.</p>

