Teyaar is one of the largest online stores for kids, baby, life style products, operating across the UAE. &nbsp;www.teyaar.com<br />

<br />

<strong>Where are the offices of Teyaar located?</strong><br />

We are a Dubai based ecommerce business owner. Our warehouses too are located throughout Dubai.<br />

<br />

<strong>How do I know my order has been confirmed?</strong><br />

After checking out during the payment process, you will get a confirmation that your payment has been processed successfully. You will also get a mail in your registered email id, confirming the order.&nbsp;<br />

<br />

<strong>Is it safe to use my Credit Card Online at Teyaar.com?</strong><br />

We accept Visa and Master Cards alongside Credit Cards. International credit/debit card transactions are also accepted through Paypal, so now you can place orders with Teyaar from outside the country and we will ship it to your dear ones to locations as per company restrictions. All transactions are safe and secure.<br />

<br />

<strong>What is the Standard Mode of Payment for transactions with Teyaar?</strong>&nbsp;<br />

In Order to make transactions easier for our customers, we accept and receive payments through Visa and Mastercard. Cash on delivery and Paypal are two other major modes of payment we allow our customers to use.<br />

<br />

<strong>What if an item is out of stock ?</strong><br />

We make every effort to keep all products in stock. However, there may be times when unexpected demands exceed our supply. In the rare circumstance where the order has been accepted and due to some reasons we are not able to ship, we will notify you within 24 hours and the money will be returned to you in the same mode by which the payment was made within 15 working days. Some of the items (which are regularly restocked) and are yet temporarily unavailable may be shown on display with the out of stock tag.&nbsp;<br />

<br />

<strong>How are the products packaged?</strong><br />

Each of the individual products are securely packaged and put into a package. It is sealed well ensuring a safe delivery to your doorstep.<br />

&nbsp;<br />

<strong>Is it required of me to register before placing an order?</strong><br />

You can place your order as a Guest by just providing us with your email address. However, it is recommended that you register with us in to receive timely offers and also to maintain your Wish list and account &amp; address details.&nbsp;<br />

<br />

<strong>How long will it take to receive my orders?</strong><br />

For areas serviced by renowned couriers, the delivery time would be within 3 to 4 business days after dispatch (business days will not include Fridays and other public holidays).<br />

<br />

<strong>Can I ship different items in my order to different shipping addresses?</strong><br />

We can only process a single shipping location per order. So, if you are interested in ordering several items to different locations, remember to make separate orders.<br />

<br />

<strong>Is it possible to return a product after I have received it?</strong><br />

Teyaar allows you to return the product within 7days after you have received it from us. However we would only accept items if we find them in their original packaged form. For more queries, you may contact our customer support.<br />

<br />

<strong>When can I get a refund on an order?</strong><br />

When it comes to refund, we work faster than you can imagine. Soon after our men have processed the return, our finance team will start working on the refund process by constantly coordinating with the customer support team. In case if you have paid through credit card, the amount will then be paid directly to your credit card account. When you pay through the cash on delivery mode, we refund the amount as store credit. In case of Paypal we refund directly into your Paypal account from which you have made the payment. We need at least 48 working hours for processing the refund after we have received the item. You can expect the money in your respective mode of payment in 15 working days.<br />

<br />

<strong>How do I check my order status?</strong><br />

Generally, we ship your package within 24 hours of receiving the order. We will also mail you the details like product information, order ID and date of shipment of your consignment to your registered email address. In case you do not receive an email within a day after you have placed the order then its time you look out for the spam folder. Alternatively, you can check the same in My Account page, where Your Order History option gives you the current status of your order.</p>

