<p><strong>1. About VAT on your Sales through Teyaar.com&nbsp;</strong></p>

<p>UAE and the Kingdom of Saudi Arabia (&ldquo;KSA&rdquo;) will introduce VAT from 1 January 2018. VAT is a consumption tax that is charged at every stage of the supply chain. VAT will be imposed on most domestic supplies of goods and services at a standard rate of 5% with few exemptions and zero-ratings. If you are VAT registered in the UAE, you are required to charge 5% VAT on all orders shipped to customers in the UAE, unless the sale is subject to the 0% VAT rate. It&rsquo;s the responsibility of each Teyaar.com Marketplace seller to ensure they are VAT-compliant and you should seek professional advice if you are unsure of your obligations.</p>

<p><strong>2. About VAT on Sales for Customers in the UAE</strong></p>

<p>As a VAT registered Marketplace Seller you are required by law to collect VAT on orders for goods shipped within the UAE.</p>

<p>For customers with an UAE delivery address, VAT shall be charged in accordance with the VAT local legislation. All the prices published in the Teyaar.com webpage must include the amount of any applicable VAT.</p>

<p><strong>3. VAT Rates</strong></p>

<p>VAT Rates may vary depending on the destination country and items being delivered.</p>

<p>The rate of VAT that applies to most supplies of goods and services in the UAE is 5%.</p>

<p>In limited circumstances, certain health and education related goods may be subject to the zero percent (0%) rate of VAT.</p>

<p><strong>4. Registration obligation in the UAE</strong></p>

<p>A resident person must register for VAT in the UAE if the value of their taxable supplies and imports, exceeds the mandatory registration threshold of AED 375,000 over a 12-month period or is anticipated to be exceeded during the next 30 days.</p>

<p>A single VAT registration and Tax Identification Number (VAT Number) applies to all business activities undertaken by you. It is your responsibility to ensure that duplicate applications are not submitted.</p>

<p>The VAT registration application is a standalone process that is different to the number obtained in relation to other taxes. This number must be used for the purposes of conducting your VAT related business activities only.</p>

<p><strong>5. Manage Your VAT Registration Number</strong></p>

<p>You can input your information relating to VAT on the selling center.</p>

<p><strong>6. About Entering your VAT Registration Number</strong></p>

<p>You can enter your information relating to VAT on the selling center<strong>.</strong></p>

<p><strong>7. About VAT Invoices to the Customers</strong></p>

<p>As a seller on Teyaar.com, it is your responsibility to comply with the VAT Law at all times.</p>

<p>Whether registered for VAT, for any goods or services supplied after 1 January 2018, you will be required to issue a valid tax invoice. The particulars to be contained a tax invoice are specified in the Article (59.1) of the VAT Executive Regulations of UAE.</p>

<p>Up<strong>on the delivery of the order, as a seller, you should expect a request from the customer to submit a Tax Invoice through the Financials tab.</strong></p>

<p><strong>8. About VAT on the commission fees charged by Teyaar.com</strong></p>

<p>The introduction of VAT will impact on the total amount of the commission charged by Teyaar.com to your business, which will include VAT at a rate of 5% from 1 January 2018.</p>

<p>The commission will be charged over the VAT exclusive prices displayed by the VAT Registered Marketplace sellers on Teyaar.com webpage. For the non-VAT registered Marketplace sellers, the commission will be charged over the final price displayed by the sellers on Teyaar.com webpage.</p>

<p>The electronic invoices in connection with the commission fee charged by Teyaar.com will be available in your log in account through the&nbsp;Orders&nbsp;tab.</p>

<p><strong>9. About VAT on items returned&nbsp;</strong></p>

<p>In case of return orders, VAT will need to be refunded to the customer by way of a Tax credit note. It is an obligation of the Marketplace Seller to provide the customers with a valid Tax credit note. Upon the return order, you should expect a request from the customer to provide with a Tax Credit Note through the Financials tab.</p>

<h2><strong>UAE Sellers VAT FAQS </strong></h2>

<p><strong>What is VAT?</strong></p>

<p>Value Added Tax, or abbreviated to &ldquo;VAT&rdquo;.</p>

<p>VAT is an indirect tax that applies to sales and purchases i.e. it is a transaction based tax. VAT operates at each level of the supply chain from producer, manufacturer, wholesaler and retailer; this ultimately ensures that VAT is accounted for at each stage of the supply chain until it finally rests with the end user.&nbsp;</p>

<p><strong>What is the rate of VAT?</strong></p>

<p>The standard rate of VAT in the UAE is 5%.</p>

<p>Specific goods and services may be subject to the 0% rate of VAT or may be VAT exempt.</p>

<p>VAT will be charged at 0% in respect of the following main categories of supplies in the UAE:</p>

<ul>

	<li>Exports of goods and services outside UAE.</li>

	<li>International transportation, and related supplies;</li>

	<li>Certain investment grade precious metals (e.g. gold, silver, of 99% purity);</li>

	<li>Supply of certain education services, and supply of relevant goods and services made by educational institutions;</li>

	<li>Supply of certain Healthcare services, and supply of certain pharmaceutical products and medical equipment.</li>

</ul>

<p><strong>When do I need to register for VAT?</strong></p>

<p>A resident person must register for VAT in the UAE if the value of their taxable supplies and imports, exceeds the mandatory registration threshold of AED 375,000 over a 12-month period or is anticipated during the next 30 days.</p>

<p>A single VAT registration and Tax Identification Number (VAT Number) applies to all business activities undertaken by you. No person can hold more than one number and it is your responsibility to ensure that duplicate applications are not submitted.</p>

<p>If you are VAT registered in the UAE or KSA and have received a VAT registration number issued by FTA or GAZT, You can enter your information relating to VAT on the selling center.<strong>&nbsp;</strong></p>

<p><strong>Remember</strong>: it&rsquo;s the responsibility of each Tyaar.com Marketplace seller to ensure they are VAT-compliant and you should seek professional advice if you are unsure of your obligations.</p>

<p><strong>What if I already have an income tax number in the UAE?</strong></p>

<p>The VAT registration application is a standalone process and you will be issued with a Tax Registration Number (VAT Number) that is different to the number obtained in relation to other taxes. This number must be used for the purposes of conducting your VAT related business activities only.</p>

<p><strong>How is VAT charged?</strong></p>

<p>In order to charge VAT you must first be registered for VAT and obtain a VAT number.</p>

<p>Once you are VAT registered, you are bound by the VAT rules applicable to the country in which you are registered but it normally means that you must charge VAT (where applicable) on your sales and show this VAT on a tax invoice (please consult your tax advisor for specific advice regarding invoicing requirements).</p>

<p>Please note that you should check VAT reporting and invoicing requirements in each country in which you register.&nbsp; Although these requirements are similar there can be notable differences. Please see section below regarding VAT invoicing.</p>

<p>&nbsp;<strong>How do I know if I should charge VAT on my supplies?</strong></p>

<p>A person who is required or elects to register for VAT must charge and collect VAT on supplies of most goods and services.</p>

<p>As a UAE VAT registered seller you are required to charge 5% VAT on all orders shipped to customers in the UAE, unless the sale is subject to the 0% VAT rate.</p>

<p>&nbsp;<strong>Is VAT paid recoverable?</strong></p>

<p>VAT can be reclaimed in certain circumstances through your VAT return.</p>

<p>Once you are VAT registered in the UAE, if you incur UAE VAT on expenditure relating to your business activities you can recover this VAT by way of your VAT return, i.e. the VAT incurred on your purchases/costs can be offset against the VAT due on your sales.&nbsp;VAT incurred on costs is referred to as input VAT.</p>

<p>A valid VAT invoice or import documentation is generally required to support a claim for VAT.</p>

<p>In connection with certain expenses detailed in the UAE VAT Law, VAT cannot be recoverable.</p>

<p><strong>What is meant by VAT exempt?</strong></p>

<p>Exempt activities refers to those that are not liable to VAT. VAT is generally irrecoverable by persons engaged in VAT exempt activities and therefore a direct cost.</p>

<p>&nbsp;<strong>What is Import VAT?</strong></p>

<p>Where you bring goods into the UAE from overseas, those goods are subject to import VAT at the first point of entry into that destination country. The rate of VAT due at import will be the same as would apply were the goods supplied within the GCC country of import.</p>

<p>Import VAT is normally recoverable provided you are registered for VAT and hold the necessary import documentation to support claims for deduction or refund of VAT.</p>

<p>&nbsp;<strong>What is a B2C Consumer?</strong></p>

<p>For the purpose of these FAQ&rsquo;s, we consider that a B2C consumer is a person who is not registered or liable to be registered for VAT.</p>

<p>These may include private individuals, public bodies, charities and businesses that are not registered because their turnover is below the VAT registration threshold or those activities are entirely exempt from VAT.</p>

<p>&nbsp;<strong>What is a B2B customer?</strong></p>

<p>For the purposes of these FAQ&rsquo;s, a business customer is a legal or natural person VAT registered, making purchases of goods and services for the purposes of carrying on a taxable business.</p>

<p>For the purposes of these FAQ&rsquo;s, we have taken for granted that a B2B customer is able to provide with his VAT registration number.</p>

<p>&nbsp;<strong>What do we mean by prices inclusive of VAT?</strong></p>

<p>All the prices published in the Teyaar.com webpage must include the amount of any applicable VAT.</p>

<p>&nbsp;<strong>Will all the categories of goods charged with 5%?</strong></p>

<p>VAT will be imposed on most domestic supplies of goods and services at a standard rate of 5% with few exemptions and zero-ratings.</p>

<p>VAT will be charged at 0% in respect of the following main categories of supplies in the UAE:</p>

<ul>

	<li>Exports of goods and services outside the UAE.</li>

	<li>International transportation, and related supplies;</li>

	<li>Certain investment grade precious metals (e.g. gold, silver, of 99% purity);</li>

	<li>Supply of certain education services, and supply of relevant goods and services made by educational institutions;</li>

	<li>Supply of certain Healthcare services, and supply of certain pharmaceutical products and medical equipment.</li>

</ul>

<p>&nbsp;<strong>How can I get myself registered for VAT?</strong></p>

<p>If you are required to register for VAT, or would like to voluntarily register for VAT, you should complete a VAT registration form via the Federal Tax Authorities online portal:</p>

<p>During the application process various documents will be requested to validate the information provided (e.g. trade license, certificate of incorporation, Emirates ID, Articles of Association, etc.).</p>

<p>The VAT registration form will also ask you to provide details about your business, such as:</p>

<ul>

	<li>Description of business activities</li>

	<li>Last 12 months turnover figures</li>

	<li>Projected future turnover figures</li>

	<li>Expected values of imports and exports</li>

	<li>Whether you expect to deal with GCC suppliers or customers</li>

	<li>Details of Customs Authority registration, if applicable</li>

</ul>

<p>The form should be completed by a person who is an authorized signatory of the business e.g. a Director, owner, someone holding Power of Attorney to sign on behalf of the business etc.</p>

<p>Following approval of the application a Tax Registration Number (VAT Number) will be issued.</p>

<p><strong>What are the benefits of getting VAT registration as a business?</strong></p>

<p>As a VAT registered business you will be obliged to charge VAT to your customers in connection with your supplies of goods or services, but you may be entitled to deduct input VAT, so that any VAT charged by your suppliers does not become a cost in your supply chain.</p>

<p>&nbsp;<strong>I have obtained my VAT Registration certificate on xxx date? Can I claim my VAT input tax preregistration, any specific requirement to meet?</strong></p>

<p>As per Article (56) of the UAE VAT Law, you may recover the Input VAT born before the VAT Registration on the first VAT Return to be submitted, provided that these Goods and Services were used to make taxable supplies that entitle you to recover VAT (e.g. non-exempt business activities).</p>

<p>However, VAT may not be recovered if the Services were received more than five years prior to the date of VAT Registration, or where the goods were moved to another Implementing State prior to the VAT Registration in the UAE.</p>

<p>&nbsp;<strong>How can I update my VAT number?</strong></p>

<p>You can enter your information relating to VAT on the selling center<strong>.&nbsp;</strong></p>

<p>&nbsp;<strong>How will VAT be calculated on the commission and other service revenue from Teyaar?</strong></p>

<p>The introduction of VAT will impact on the total amount of the commission charged by Teyaar.com to your business, which will include VAT at a rate of 5% from 1 January 2018.</p>

<p>The commission will be charged over the VAT exclusive prices displayed by the VAT Registered Marketplace sellers on Teyaar.com webpage. For the non-VAT registered Marketplace sellers, the commission will be charged over the final price displayed on Teyaar.com webpage.</p>

<p>&nbsp;<strong>How can I get my tax Invoice?</strong></p>

<p>The electronic invoices in connection with the commission fee charged by Teyaar.com will be available in your log in account through the Orders tab.</p>

<p>&nbsp;<strong>Who will be responsible of issuing Tax Invoice to the customer?</strong></p>

<p>As a seller on Teyaar.com, it is your responsibility to comply with the VAT Law at all times. This includes issuing valid tax invoices on sales made to customers (where necessary), collecting VAT (if applicable) and payment of VAT to the UAE Federal Tax Authority (&ldquo;FTA&rdquo;).</p>

<p><strong>How will I know if I have to issue Tax Invoice to my customers?</strong></p>

<p>If you are registered for VAT, for any goods or services supplied after 1 January 2018, you will be required to issue a valid tax invoice. The particulars to be contained a tax invoice are specified in the Article (59.1) of the VAT Executive Regulations of UAE.</p>

<p>&nbsp;<strong>How can my customers ask for a tax Invoice? Will </strong>Teyaar<strong>.com providing them with the Contact Us information or is there any support center for facilitating these queries?</strong></p>

