<p><strong>1.Search and explore products</strong><br />

We have a wide range of fabulous products to choose from.<br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip 1:</strong> If you&#39;re looking for a specific product, use the keyword search box located at the top of the site. Simply type what you are looking for, and prepare to be amazed!</p>

<p><strong>&bull;&nbsp;&nbsp; &nbsp;Tip 2:</strong> If you want to explore a category of products, use the &quot;Shop All Categories&quot; menu, and navigate through your favorite categories where we&#39;ll feature the best products in eac<br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip&nbsp;3:</strong>&nbsp;Or just&nbsp;<strong>explore</strong>&nbsp;through our home page and prepare to be surprised by the latest and best deals in your city.<br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip&nbsp;4:</strong>&nbsp;While exploring and searching, check out the the key info we display under each product. You may also use our various sorting methods, and the filters on left to narrow down the results to fit your needs - as per product features and price.&nbsp;<strong>Click on the product you want</strong>&nbsp;to learn more about and get ready to buy.</p>

<p><strong>2. Learn about the product, and Add to cart</strong><br />

Check out the product details, images, specs, videos, and customer reviews. We feature the best seller so click &quot;Add to cart&quot; if the price and seller rating are convenient for you, or explore the &quot;more offers&quot; box for more buying options and further sellers and product conditions for all needs.</p>

<p><strong>3. Review your shopping cart, and Sign in to checkout</strong><br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip 1:</strong> Review your cart and click &quot;Proceed to checkout&quot;. Just make sure that all products you want to buy now are there in the shopping cart, and those you want to buy later, if any, are moved to &quot;Saved for later&quot; cart.<br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip&nbsp;</strong> <strong>2:</strong> If you&#39;re a registered user then just sign in to your account.<br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip 3:</strong> If you&#39;re not registered yet then simply do by filling our form, or just connect through your facebook account by one simple click.</p>

<p><strong>4. Place your order</strong><br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip 1:</strong> Provide your address details, where you would like us to deliver your order, and click &quot;Save&quot;.&nbsp;<br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip 2:</strong> Review the address and shipping services selected as well as the delivery period. Click &quot;Next&quot;.<br />

<strong>&bull;&nbsp;&nbsp; &nbsp;Tip 3:</strong> Select your favorite payment method from the convenient payment options we provide. When selecting Credit Cart, fill out your card details. Once done, just click &quot;Place Order&quot;.</p>

<p><strong>5. Congrats! Track your order until it&#39;s delivered to your door</strong><br />

Wondering what happened to your order? Worry not, with Teyaar.com you have an option to check the progress of the shipment, so you won&#39;t lose track of your order. Just navigate to &quot;My account&quot; to check the status of your orders, where you may also provide your feedback upon delivery.<br />

Teyaar.com works with trusted logistics and fulfillment partners to deliver your products to your door as fast as possible, and in the safest conditions.<br />

&nbsp;</p>

