<p>The present Privacy Policy (the Privacy Policy) sets forth the terms and policy concerning the collection, usage and handling of Users personal information on the Website.</p>

<p>Under this Privacy Policy, we will be referred to as we, us, our, and other similar expressions, and Users will be referred to as you, and other similar expressions.</p>

<p><strong>1. INFORMATION COLLECTED</strong></p>

<p>By accessing or using our Website, we may be able to collect information that is of a personal or general nature.</p>

<p><strong>1.1. Personal Information</strong></p>

<p>According to applicable law, personal information refers to information about an identifiable individual. Personal information can include but is not limited to your name, address, email, payment information, purchase history, Campaign involvement and other relevant information. Your personal information will be provided to us upon your creation of a user account, your registration on the Website as a member, or when you sign up using your email address.</p>

<p>We will only collect personal information you provide voluntarily on the Website or in accordance with this Privacy Policy.</p>

<p><strong>1.2. GENERAL INFORMATION</strong></p>

<p>Upon accessing the Website, we may be able collect information of a general nature. Such information includes your browsing history, the time spent on the Website, your IP address and other information that cannot identify you as an individual, but instead refers to information about your online activity and browsing.</p>

<p><strong>2. PAYMENT INFORMATION</strong></p>

<p>Any payments made using or involving the Website will be made using an unaffiliated payment service. All payment information you provide, including but not limited to your credit or debit card information, will not be shared, sold or leased to any third party, except with your prior explicit consent. Your payment information will be solely used to effect the purchases and transactions you make on the Website.</p>

<p><strong>3. PURPOSE OF THE COLLECTION OF INFORMATION</strong></p>

<p>We will only use the personal information you provide on the Website for the purposes indicated in this Privacy Policy, except if you explicitly authorize the communication of your personal information for another purpose.</p>

<p>The personal information provided on the Website will be used for the purposes set out in our Terms and Conditions, namely, to allow you to make purchases using the Website and to enter</p>

<p>into Campaigns. The usage of your personal information will be reasonably limited to the extent necessary to execute the following:</p>

<ul>

 <li>

 <p>- to make a purchase on the Website;</p>

 </li>

 <li>

 <p>- to receive customized information relating to pricing, items listed for sale, and other</p>

 <p>similar information with respect to the products offered for sale on the Website;</p>

 </li>

 <li>

 <p>- to inform you of products and opportunities that may be of interest;</p>

 </li>

 <li>

 <p>- to communicate with you with respect to a purchase, payment, promotion, or to</p>

 <p>provide any other information;</p>

 </li>

 <li>

 <p>- to respond to any questions, feedback or other inquiries you send us.</p>

 <p>The usage of general information relating to you will be reasonably limited to the extent necessary to execute the following:</p>

 </li>

</ul>

<ul>

 <li>

 <p>- to assess the Website and its products and to ensure its proper functioning;</p>

 </li>

 <li>

 <p>- to improve the Website and assess your interests;</p>

 </li>

 <li>

 <p>- to monitor the usage of the Website;</p>

 </li>

 <li>

 <p>- to conduct research relating to the Website.</p>

 </li>

</ul>

