INSERT INTO articles VALUES (24, 1, '<p>Teyaar.com has a "Buyer Protection Program" which seeks to assist buyers to ensure their purchase is protected against fraud by any sellers on the Site. If a buyer has purchased an item by way of any of the Teyaar SafePay processes and never received it or received an item worth significantly less in value compared to what was described by the seller, the buyer may seek protection under the Buyer Protection Program. The Buyer Protection Program involves reimbursement by Teyaar.com to the buyer of the value of the item only. To be eligible under the Buyer Protection Program a buyer needs to file a complaint with Teyaar.com within 48 hours of receiving (or not receiving) the relevant item. Teyaar.com will investigate the matter and if it has been determined (by Teyaar.com in its sole discretion) that the seller has intentionally defrauded the buyer in relation to the item for which Teyaar.com has reimbursed the buyer, Teyaar.com may limit, suspend or withdraw the seller&#39;s access to the Site and/or the seller&#39;s membership and Teyaar.com may charge the seller for Teyaar.com&#39;s costs in reimbursing the buyer and for any handling and shipping (in accordance with the Fees & Credit Policy . Teyaar.com reserves the right to take such further steps as it considers necessary including without limitation legal action. You acknowledge and agree that if any item returned to Teyaar.com by a buyer is illegal or otherwise unlawful that Teyaar.com may in its sole discretion destroy the item or take any other steps as it considers necessary.<br>
